Let's break down the problem step-by-step:

1. **Identify the original price:** The book originally cost $19.50.

2. **Calculate the discount percentage:** The discount is 25%.

3. **Calculate the discount amount:** To find the discount amount, multiply the original price by the discount percentage:
   Discount = 0.25 * $19.50 = $4.875

4. **Calculate the sale price:**  Subtract the discount amount from the original price:
   Sale Price = $19.50 - $4.875 = $14.625

5. **Round to the nearest cent:** Since we're dealing with money, we need to round the sale price to two decimal places.  $14.625 rounds to $14.63.

Therefore, the sale price of the book is $14.63.

