  // Calculate the discount amount
  let discount_amount = original_price * (discount_percentage / 100.0);

  // Calculate the sale price
  let sale_price = original_price - discount_amount;

  // Round the sale price to two decimal places
  let rounded_sale_price = round(sale_price, 2);

  // Output the sale price
  print(rounded_sale_price);
</algorithm>
