1. Let x be the number of points Jojo gets.
2. We know that the total number of points is 251.
3. We know that Naomi gets 68 points.
4. We know that Yuri gets 10 more points than Naomi, so Yuri gets 68 + 10 = 78 points.
5. We know that Brianna gets 17 more points than Naomi, so Brianna gets 68 + 17 = 85 points.
6. The total points of Naomi, Yuri, and Brianna are 68 + 78 + 85 = 231.
7. Since the total number of points is 251, Jojo gets 251 - 231 = 20 points.

Therefore, Jojo gets 20 points.

