        // We know that the total number of points is 251.
        int totalPoints = 251;

        // We know that Naomi gets 68 points.
        int naomiPoints = 68;

        // We know that Yuri gets 10 more points than Naomi, so Yuri gets 68 + 10 = 78 points.
        int yuriPoints = naomiPoints + 10;

        // We know that Brianna gets 17 more points than Naomi, so Brianna gets 68 + 17 = 85 points.
        int briannaPoints = naomiPoints + 17;

        // The total points of Naomi, Yuri, and Brianna are 68 + 78 + 85 = 231.
        int naomiYuriBriannaPoints = naomiPoints + yuriPoints + briannaPoints;

        // Since the total number of points is 251, Jojo gets 251 - 231 = 20 points.
        jojoPoints = totalPoints - naomiYuriBriannaPoints;

        // Print the result.
        System.out.println("Jojo gets " + jojoPoints + " points.");
    }
}
